import React, { useState, useEffect } from 'react';
import { Plus, Save, Trash2 } from 'lucide-react';
import { saveFoodItems, getFoodItems } from '../utils/localStorage';
import './ManualEntry.css';

const ManualEntry = () => {
  const [foodItems, setFoodItems] = useState([]);
  const [newItem, setNewItem] = useState({
    name: '',
    calories: '',
    mealType: 'breakfast'
  });

  const mealTypes = [
    { value: 'breakfast', label: 'Breakfast' },
    { value: 'lunch', label: 'Lunch' },
    { value: 'dinner', label: 'Dinner' },
    { value: 'snack', label: 'Snack' }
  ];

  // Load food items from localStorage on component mount
  useEffect(() => {
    const savedItems = getFoodItems();
    setFoodItems(savedItems);
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewItem(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleAddItem = () => {
    if (newItem.name && newItem.calories) {
      const item = {
        ...newItem,
        id: Date.now(),
        date: new Date().toISOString().split('T')[0]
      };
      const updatedItems = [...foodItems, item];
      setFoodItems(updatedItems);
      saveFoodItems(updatedItems);
      setNewItem({
        name: '',
        calories: '',
        mealType: 'breakfast'
      });
    }
  };

  const handleRemoveItem = (id) => {
    const updatedItems = foodItems.filter(item => item.id !== id);
    setFoodItems(updatedItems);
    saveFoodItems(updatedItems);
  };

  const totalCalories = foodItems.reduce((sum, item) => sum + parseInt(item.calories || 0), 0);

  return (
    <div className="manual-entry">
      <div className="container">
        <div className="page-header">
          <h1>Manual Entry</h1>
          <p>Manually input your food items and calories for precise tracking</p>
        </div>

        <div className="entry-section">
          <div className="entry-form card">
            <h3>Add Food Item</h3>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="name">Food Name</label>
                <input
                  type="text"
                  id="name"
                  name="name"
                  value={newItem.name}
                  onChange={handleInputChange}
                  placeholder="e.g., Grilled Chicken Breast"
                />
              </div>
              <div className="form-group">
                <label htmlFor="calories">Calories</label>
                <input
                  type="number"
                  id="calories"
                  name="calories"
                  value={newItem.calories}
                  onChange={handleInputChange}
                  placeholder="250"
                />
              </div>
              <div className="form-group">
                <label htmlFor="mealType">Meal Type</label>
                <select
                  id="mealType"
                  name="mealType"
                  value={newItem.mealType}
                  onChange={handleInputChange}
                >
                  {mealTypes.map(type => (
                    <option key={type.value} value={type.value}>
                      {type.label}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <button onClick={handleAddItem} className="btn btn-primary">
              <Plus size={16} />
              Add Item
            </button>
          </div>

          <div className="food-list card">
            <div className="list-header">
              <h3>Today's Food Items</h3>
              <div className="total-calories">
                Total: <span className="calorie-count">{totalCalories}</span> calories
              </div>
            </div>

            {foodItems.length === 0 ? (
              <div className="empty-state">
                <p>No food items added yet. Start by adding your first meal!</p>
              </div>
            ) : (
              <div className="food-items">
                {foodItems.map(item => (
                  <div key={item.id} className="food-item">
                    <div className="item-info">
                      <h4>{item.name}</h4>
                      <span className="meal-type">{item.mealType}</span>
                    </div>
                    <div className="item-calories">
                      {item.calories} calories
                    </div>
                    <button
                      onClick={() => handleRemoveItem(item.id)}
                      className="remove-item-btn"
                    >
                      <Trash2 size={16} />
                    </button>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ManualEntry;
